import React from 'react';
import object from './Object';
import Card from './Card';

const Netflix=()=>{
    return(
        <Card 
        imgsrc={object[1].imgsrc}
        title={object[1].title}
        sname={object[1].sname}
        links={object[1].links}
        />
      )
}

export default Netflix
